static inline void HSD_WObjUnref(HSD_WObj* wobj)
{
    if (wobj == ((void*) 0)) {
        return;
    }
    if (ref_DEC(wobj) != 0) {
        if (wobj != ((void*) 0)) {
            (wobj->parent.parent.class_info)->release((HSD_Class*) wobj);
            (wobj->parent.parent.class_info)->destroy((HSD_Class*) wobj);
        }
    }
}
